// App.js
import React from "react";
import Navbar from "./components/Navbar";
import Carousel from "./components/Carousel";
import SectionsContainer from "./components/SectionsContainer";
import Footer from "./components/Footer";

function App() {
  return (
    <div>
      <Navbar />
      <main>
        <Carousel />
        <SectionsContainer />
      </main>
      <Footer />
    </div>
  );
}

export default App;
